  `MATRICP_Codigo` int NOT NULL,
  `EMPRP_Codigo` int DEFAULT NULL,
  `CALIFICAC_Puntaje` double DEFAULT '0',
  `CALIFICAC_Situacion` char(1) DEFAULT '1' COMMENT '1: Pendiente, 2:OK, 3:Leve, 4:Retraso',
